import React from "react";
import './maisvendidos.css';
import Swiper from 'react-swiper';
import { Navigation, Pagination } from 'swiper/modules';
import macarrao from '../../imagens/Macarrao com camarão 1.png';


const slides = [
    {
      image: "image1.jpg",
      title: "Prato 1",
      description: "Descrição do Prato 1"
    },
    // {
    //   image: "image2.jpg",
    //   title: "Prato 2",
    //   description: "Descrição do Prato 2"
    // },

];


function MaisVendidos(){
    return (
        <section className="sec5__maisVendidos">
            <h2>Pratos mais vendidos</h2>
            <div className="sec5__pratos">
                <Swiper
                    modules={[Navigation, Pagination]}
                    spaceBetween={50}
                    slidesPerView={3}
                    navigation
                    pagination={{ clickable: true }}
                    >
                    {slides.map((slide, index) => (
                        <div key={index}>
                            <img></img>
                        </div>
                    ))}
                </Swiper>
            </div>
        </section>
    )
}

export default MaisVendidos;
